import React from 'react';
import './App.css';
import Main from '../Main/Main';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

class App extends React.Component {
    render() {
        return (
            <Router>
                <div className="App">
                    <Main />
                </div>
            </Router>
        );
    }
}

export default App;
